import tkinter as tk
from tkinter import ttk
import time
import threading
import os
from PIL import Image, ImageTk
import base64
from io import BytesIO

# Messaggio in ebraico
message = "שלום אליה, אנחנו בתוך המחשב שלך"

def fake_loading():
    for i in range(101):
        time.sleep(0.03)
        progress_var.set(i)
        progress_bar.update()
    root.destroy()

# Immagine del logo Mossad incorporata direttamente nel codice (base64)
logo_data = """

"""

root = tk.Tk()
root.title("Israele")
root.geometry("400x250")
root.resizable(False, False)
root.protocol("WM_DELETE_WINDOW", lambda: None)

# Decodifica l'immagine
image_data = base64.b64decode(logo_data)
image = Image.open(BytesIO(image_data))
photo = ImageTk.PhotoImage(image)

logo_label = tk.Label(root, image=photo)
logo_label.image = photo
logo_label.pack(pady=10)

label = tk.Label(root, text=message, font=("Arial", 14), justify="center")
label.pack(pady=5)

progress_var = tk.IntVar()
progress_bar = ttk.Progressbar(root, maximum=100, length=350, variable=progress_var)
progress_bar.pack(pady=15)

threading.Thread(target=fake_loading, daemon=True).start()

root.mainloop()